import React from 'react'
import Layout from "../Layout/Layout";
import ContactForm from '../components/ContactForm'
import CenterWrapper from '../components/CenterWrapper'
import Fullscreen from '../components/Fullscreen'
import styled from "@emotion/styled";

const Description = styled.div`
    p{
      text-align: center;
      font-size: 1.8rem;
      line-height: 1.6;
      max-width: 700px;
      margin: 3rem 2rem 2rem 2rem;
    }
`;


function App({ data }) {

  return(
  <Layout>

    <Fullscreen image="/img/supsafari.jpg"  text="#fff">
    <img className="logo" loading="lazy" width="240px" src="/logo-red.svg"  alt="sup safari logo" />
    <h1>SUP-utleie&#x1F3C4; i Fredrikstad og Hvaler</h1>
    </Fullscreen>


      <CenterWrapper>
      <Description>
      <p>
      Opplev elver, innsjøer og skjærgården stående!	&#x1F3C4;
      Vi tilbyr utleie av SUPbrett til <strong>paddleturer i Fredrikstad og Hvaler-regionen.</strong> Vi tar gjerne en prat. Legg igjen navn, epost og når du ønsker å leie. Vi prekæs &#128526; &#129305; 
      </p>
      </Description>
      <ContactForm />
      </CenterWrapper>



</Layout>
)

}

export default App
